import React from "react";
import File from "./resume";

import { Link } from "react-router-dom";

const Apply = () => (

    <div>
        Upload Resume: <span>  </span>
        <input className="form__input" type="file" name="file" onChange={(e) => this.onchange(e)} required />
        <hr />

        <File />

        <button className="form__button" type="submit" value="Apply"> 

            <Link to="/success">Apply</Link>

        </button>

    </div>

);

export default Apply;
